import React from "react";
import "../Header/Header.scss";
import brandlogo from "../../assets/images/wrench-black-100x100.png";

function Header() {
  return (
    <>
      <header className="brand__header">
        <nav className="brand__nav">
          <ul className="brand__list">
            <li className="brand__item">
              <a className="brand__site-link" href="/">
                <img
                  className="brand__site-logo"
                  src={brandlogo}
                  alt="The brand logo of the website is a wrench symbolizing to fix/adjust to a new/existing habit"
                />
              </a>
            </li>

            <li className="brand__item">
              <a className="brand__item-title" href="/">
                Habitualr
              </a>
            </li>
            <li className="brand__item">Motivation</li>
            <li className="brand__item">Tracking</li>
          </ul>
        </nav>
      </header>
    </>
  );
}

export default Header;
